class Homepage extends Component {
    render(){
        return(
            <div className = "bg">
                <Container fluid ={true}>
                <Row>
                    <Col >
                            <Spotlight link = "https://byesammy.com/"/>  
                    </Col>

                    <Col lg={3} md = {6} sm = {12} xs="12"><AssetArsenal/></Col>
                </Row>
                </Container>
            </div>

        )
    }
}
export default Homepage
